(1, '1234', 'El Se침or de los Anillos', 'J. R. R. Tolkien', '1954-06-29 19:52:36', 'La novela narra el viaje del protagonista principal, Frodo Bols칩n, hobbit de la Comarca, para destruir el Anillo 칔nico y la consiguiente guerra que provocar치 el enemigo para recuperarlo, ya que es la principal fuente de poder de su creador, el Se침or oscuro, Sauron.', 1, 1392, 0, 1),
(2, '0412', 'Battle Royale', 'Koushun Takami', '1999-04-27 08:37:10', 'En la Rep칰blica del Gran Oriente Asi치tico est치 prohibido el rock. Como medida de control de rebeliones, la administraci칩n pone en marcha el Programa: cada a침o, 50 clases de distintos institutos son elegidas para luchar a muerte en la BATTLE ROYALE. Los alumnos elegidos son aislados en una isla. Las normas del juego son estrictas: no pueden escapar, no pueden contactar con el exterior, y solo puede quedar uno. Todo est치 permitido para sobrevivir.', 2, 688, 0, 2),
(3, '7283', 'IT', 'Stephen king', '1988-09-15 16:22:46', 'Cuenta la historia de un grupo de siete ni침os que son aterrorizados por un malvado monstruo, al que llaman 춺Eso췉, que es capaz de cambiar de forma, aliment치ndose del terror que produce en sus v칤ctimas. ', 3, 1504, 0, 3),
