(5, '3167', 'Harry Potter y la piedra filosofal', 'J. K. Rowling', '1997-06-26 00:00:00', 'Harry Potter se ha quedado hu칠rfano y vive en casa de sus abominables t칤os y el insoportable primo Dudley. Harry se siente muy triste y solo, hasta que un buen d칤a recibe una carta que cambiar치 su vida para siempre. En ella le comunican que ha sido aceptado como alumno en el Colegio Hogwarts de Magia. A partir de ese momento, la suerte de Harry da un vuelco espectacular.', 5, 223, 0, 4),
(6, '9645', 'La Bestia', 'Carmen Mola', '2021-11-04 16:15:28', 'Corre el a침o 1834 y Madrid, una peque침a ciudad que trata de abrirse paso m치s all치 de las murallas que la rodean, sufre una terrible epidemia de c칩lera. Pero la peste no es lo 칰nico que aterroriza a sus habitantes: en los arrabales aparecen cad치veres desmembrados de ni침as que nadie reclama. Todos los rumores apuntan a la Bestia, un ser a quien nadie ha visto pero al que todos temen. Cuando la peque침a Clara desaparece, su hermana Luc칤a, junto con Donoso, un polic칤a tuerto, y Diego, un periodista buscavidas, inician una fren칠tica cuenta atr치s para encontrar a la ni침a con vida. En su camino tropiezan con fray Braulio, un monje guerrillero, y con un misterioso anillo de oro con dos mazas cruzadas que todo el mundo codicia y por el que algunos est치n dispuestos a matar.', 6, 544, 1, 5),
(7, '3742', 'El 칰ltimo Cat칩n', 'Matilde Asensi', '2001-02-01 11:00:00', 'Desde el archivo secreto de la ciudad del Vaticano, la hermana Ottavia Salina, pale칩grafa de prestigio internacional, se enfrenta a un extra침o enigma: descifrar los tatuajes aparecidos en el cad치ver de un et칤ope. Con la ayuda de un capit치n de la guardia suiza y un arque칩logo de Alejandr칤a, Ottavia tendr치 que descubrir qui칠n est치 detr치s del robo en las iglesias de todo el mundo de las reliquias de la Vera Cruz, la cruz de Cristo. Siete pruebas basadas en el purgatorio de la Divina comedia de Dante Alighieri tienen las llaves para abrir las puertas. La expiaci칩n de los siete pecados capitales se realizar치 en las siete ciudades que ostentan la fama de practicarlos: Roma por su soberbia, R치vena por su envidia, Jerusal칠n por su ira, Atenas por su pereza, Constantinopla por su avaricia, Alejandr칤a por su gula y Antioqu칤a por su lujuria.', 7, 640, 0, 5),
(8, '6368', 'Los Juegos del Hambre', 'Suzanne Collins', '2008-09-14 05:34:00', 'Es la hora. Ya no hay vuelta atr치s. Los juegos van a comenzar. Los tributos deben salir a la Arena y luchar por sobrevivir. Ganar significa Fama y riqueza, perder significa la muerte segura... 춰Que empiecen los Septuag칠simo Cuartos Juegos del Hambre! Un pasado de guerras ha dejado los 12 distritos que dividen Panem bajo el poder tir치nico del Capitolio. Sin libertad y en la pobreza, nadie puede salir de los l칤mites de su distrito. S칩lo una chica de 16 a침os, Katniss Everdeen, osa desafiar las normas para conseguir comida. Sus prinicipios se pondr치n a prueba con Los juegos del hambre, espect치culo televisado que el Capitolio organiza para humillar a la poblaci칩n. Cada a침o, 2 representantes de cada distrito ser치n obligados a subsistir en un medio hostil y luchar a muerte entre ellos hasta que quede un solo superviviente.', 8, 374, 0, 9),
(9, '9863', 'El Libro Negro de las Horas', 'Eva Garcia Saenz de Urturi', '2022-02-02 08:40:00', 'Alguien que lleva muerto cuarenta a침os no puede ser secuestrado y, desde luego, no puede sangrar. Vitoria, 2022. El exinspector Unai L칩pez de Ayala -alias Kraken- recibe una llamada an칩nima que cambiar치 lo que cree saber de su pasado familiar: tiene una semana para encontrar el legendario Libro Negro de las Horas, una joya bibliogr치fica exclusiva, si no, su madre, quien descansa en el cementerio desde hace d칠cadas, morir치. 쮺칩mo es esto posible? Una carrera contrarreloj entre Vitoria y el Madrid de los bibli칩filos para trazar el perfil criminal m치s importante de su vida, uno capaz de modificar el pasado, para siempre.', 9, 384, 1, 5),
(10, '7564', 'Reina Roja', 'Juan G칩mez-Jurado', '2018-11-08 08:24:00', 'Antonia Scott es especial. Muy especial. No es polic칤a ni criminalista. Nunca ha empu침ado un arma ni llevado una placa, y, sin embargo, ha resuelto decenas de cr칤menes. Pero hace un tiempo que Antonia no sale de su 치tico de Lavapi칠s. Las cosas que ha perdido le importan mucho m치s que las que esperan ah칤 fuera. Tampoco recibe visitas. Por eso no le gusta nada, nada, cuando escucha unos pasos desconocidos subiendo las escaleras hasta el 칰ltimo piso. Sea quien sea, Antonia est치 segura de que viene a buscarla. Y eso le gusta a칰n menos.', 10, 568, 0, 5),
(11, '4636', '츼ngeles y Demonios', 'Dan Brown', '2000-03-01 11:00:00', 'El profesor de simbolog칤a Robert Langdon recibe una misteriosa llamada a las tantas de la madrugada y se ve envuelto en una persecuci칩n en la que tratar치 de evitar la destrucci칩n de la Ciudad del Vaticano. Acompa침ado de la cient칤fica Vittoria Vetra, ambos deber치n encontrar la guarida de los Illuminati para detener a un hombre cuyo prop칩sito es hacer explotar la antimateria y destruir el altar principal de la Iglesia junto a todas las personas que est칠n a su alrededor. ', 11, 688, 0, 5),
(12, '9043', 'El Italiano', 'Arturo P칠rez-Reverte', '2021-09-21 05:33:00', 'En los a침os 1942 y 1943, durante la Segunda Guerra Mundial, buzos de combate italianos hundieron o da침aron catorce barcos aliados en Gibraltar y la bah칤a de Algeciras. En esta novela, inspirada en hechos reales, s칩lo algunos personajes y situaciones son imaginarios. Elena Arbu칠s, una librera de veintisiete a침os, encuentra una madrugada mientras pasea por la playa a uno de esos buzos, desvanecido entre la arena y el agua. Al socorrerlo, la joven ignora que esa determinaci칩n cambiar치 su vida y que el amor ser치 s칩lo parte de una peligrosa aventura.', 12, 400, 1, 1);

